function playSFX(url, position) {
    let playPosition = position;
    if (playPosition == undefined) {
        playPosition = feature.position;
    }
    let sfx = parcel.createFeature('audio');
    sfx.set({
        position: [playPosition.x, playPosition.y, playPosition.z],
        scale: [0, 0, 0],
        autoplay: true,
        loop: false,
        rollloffFactor: 0,
        sprite: true,
        streaming: false,
        url: url,
        volume: 1
    });
    setInterval(() => {
        parcel.removeFeature(sfx);
    }, 2000)
}

feature.on('click', async function (e) {
    try {
        let postData = {
            player: {
                name: e.player.name,
                wallet: e.player.wallet
            },
            parcel: {
                id: parcel.id,
                owner: parcel.owner
            },
            feature: {
                id: feature.id,
                position: feature.position,
            }
        };
        let result = await fetch("https://cv.agentsecretroom.in/cw-easter-egg",
            {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json;charset=utf-8'
                },
                body: JSON.stringify(postData)
            });
        let resultData = await result.json();
        console.log("result", await resultData);
        if (resultData.foundAll) {
            playSFX("https://cdn.discordapp.com/attachments/935907342153809950/964909744798175232/win31.mp3", feature.position)
        } else if (resultData.success) {
            playSFX("https://cdn.discordapp.com/attachments/935907342153809950/964909411053224056/ae1739700d3e85e.mp3", feature.position)
        }
    } catch (e) {
        console.log(e);
    }
});
